(3, 'George Town: the unexpected street art hub of Southeast Asia', 'The trend goes back to 2010, when the government of Penangcommissioned the studio Sculpture At Work (sculptureatwork.com) to create a series of cartoon steel art pieces to decorate its capital, George Town. Affixed to walls, these 3D artworks detail local customs and heritage with humour while also providing a quirky counterpoint to the natural urban beauty of the city\'s historic core. Examples range from a mural on Lebuh Muntri marking the shop where world-famous shoemaker (and Penang native) Jimmy Choo first apprenticed, to a tuak(toddy or palm wine) shop on Lorong Pasar fronted by a nearly life-sized mural of a man scaling a palm tree.^^But the real star of George Town\'s street art scene is undoubtedly Lithuanian artist, Ernest Zacharevic (facebook.com/Ernestzachas). For the 2012 George Town Festival, Zacharevic was commissioned to do a series of public paintings in central George Town, many of which he chose to combine with objects such as swings, motorcycles and extant architectural features. The art has been a smash hit, with Zacharevic\'s most famous piece, a girl and a boy riding a real bicycle on Lebuh Armenian (Armenian Street), now a legitimate tourist destination in George Town, complete with long queues for selfies and a dedicated souvenir stall. Zacharevic\'s images are now also found on shirts, notebooks and other souvenirs - often without his permission. ^^\'The initial reaction was surprise,\' says Zacharevic of local people\'s impressions of his earliest pieces. \'There was no street art scene [at the time] in Malaysia, and people had a negative stigma about graffiti.\'^^Adds the artist, who has been described as \'Asia\'s Banksy\', \'I wasnâ€™t surprised that the paintings stood out, but I am surprised that theyâ€™ve lasted this long and have become so popular.\'^^The success of Zacharevic\'s street art has inspired similar works such as \'101 Lost Kittens\', a series of murals located near the corner of Lebuh Armenian and Lebuh Pantai, commissioned for the 2013 George Town Festival with the intent of bringing attention to the issue of stray animals. The trend has also inspired several examples of privately-funded public street art, some of which span the walls of mutistorey buildings, not to mention street art-themed cafes and a \'3D art\' museum. ^^All the while, Zacharevic\'s pieces, typically integrated with and open to the natural environment, have begun to to fade, flake and, perhaps most infamously in the case of his famous bicycle piece in August 2015, become vandalised. ^^\'I\'m kind of happy for them to disappear,\' Zacharevic tells Lonely Planet. \'I\'m just as much a spectator as everybody else.\'^^The locations of Zacharevic\'s iconic street art pieces, along with more than 30 works by other artists, are pinpointed in \'Marking George Town\', a map available at the office of Penang Global Tourism (and also in some hotels) in George Town. ^^', 'Chan Wei Lun', 'Georgetown1.jpg'),
(4, 'George Town\'s street food: what to eat in Malaysia\'s food capital', 'We\'re just going to come out and say it: George Town is the best food city in Southeast Asia. Locals have been in on the secret for years, but so expertly has Penang\'s capital blended flavours and cooking styles from across Malaysia, China, India, Thailand and beyond, that it is fast emerging as a pilgrimage site for any serious foodie.^^Ranging from shophouse-bound \'cafes\' to open-air conglomerations of mobile stalls, George Townâ€™s legendary hawker centres offer a cheap, informal introduction to the local cuisine. Perhaps most importantly, the quality\'s also there, assuring that that cheap, delicious dish you had at the side of the road will most likely be good. Read on for ten top dishes worth sampling, and who does \'em best.^^Asam laksa^^Quite possibly Penangâ€™s most famous dish is this local take on laksa, Malaysiaâ€™s national noodle, made with thick rice-based noodles and a hearty, fishy, tart, herbal broth. A renowned version is available at the hawker-style Joo Hooi Cafe.^^Cendol^^This sweet, odd-but-refreshing mixture of fine noodles made from green-bean flour dough, coconut milk, Melaka\'s famous palm sugar and shaved ice, is available across the country, but the vendor at George Townâ€™s Joo Hooi Cafe pulls a fanatical fan base.^^Char kway teow^^Silky rice noodles stir-fried with plump prawns, briny cockles, chewy Chinese sausage, crispy sprouts, fluffy egg and a hint of chilli make up this beloved street food staple. Easily the most famous vendor in Penang is Kafe Heng Huat, one of a strip of vendors at the Lg Selamat Hawker Stalls.^^Curry mee^^This dish unites two types of noodles â€“ hearty wheat-and-egg and thin strands made from rice â€“ in a coconut milk-based curry broth with deep-fried tofu, prawns, cockles, cubes of pork blood and a generous dollop of spicy chili-based paste. Try the version sold at the morning market at the Pulau Tikus Hawker Stalls on Jl Pasar.^^Chee cheong fun^^Simple yet delicious is this dish of rice noodle rolls, steamed and served drizzled with shallot oil, a dressing made from local shrimp paste, a dollop of chili paste and a garnish of toasted sesame seeds. Cheong Kok Choy, operating out of the Lg Baru (New Lane) Hawker Stalls, is one of George Townâ€™s more famous chee cheong fun vendors.^^Lor bak^^Love a deep-fried snack? When it features seasoned pork wrapped in tofu skin, prawn fritters, taro, tofu and two types of dips, itâ€™s hard not to. A good introduction to this dish is the version dished up at legendary street food vendor Kafe Kheng Pin.^^Nasi kandar^^Not technically a dish, nasi kandar is more a style of eating, one associated strongly with George Town. Kandar is the name of a wooden pole formerly used to carry vats of curries by mobile vendors. Today, the vendors are stationary, but the rich, meaty Indian-Muslim-influenced curries they used to carry live on. Nasi kandar-style dishes are available at several places in George Town, including Hammediyah, allegedly the oldest nasi kandar restaurant in Malaysia.', 'Ong Jean Min', 'laksa.jpg'),
(5, 'George Town â€“Where Design and Culture Must Continue to Merge', 'George Townâ€™s built heritage is a great example of design moderated by cultural context. We notice this in the cityâ€™s morphology, the building typologies lining the streets, and the spaces between the public realm and private sanctuaries. The architectural notions of harmony and proportion and of lightness and weight are unavoidably present, bringing to our minds poignant moments of history^^Timeâ€™s passing is captured in these studied variations. For this experience, we owe a debt to the master builders who planted these traditions and who crafted decoration in stucco and ceramics to celebrate mythical tales.^^ Diverse cultures that carry the routes and roots of the city and its inhabitantsâ€™ being are embedded here. Human dimensions scale the city to allow spires to commune with heaven.^^^^GEORGE TOWN CANNOT help telling a thousand tales. The â€œoutstanding universal valuesâ€ that emanate from its foundation of culturally informed design was noticed by Unesco, and earned it â€“ together with Malacca â€“ World Heritage status in 2008. This inscription was a godsend, and has offered a unique global platform for Penang to convey self-belief, self-esteem, self-renewal and civic pride. It has set the stage to bring world ideas home.^^Such global recognition can be the catalyst for a forward-looking social movement only if cultural sustainability remains the touchstone. The currents of change today are strong, and since the management of changes is necessarily reactive, it would be wise for us to adopt sound place-making principles and people-centred conservation policies.', 'Jess Ong', 'windows.png'),
(6, 'From food to art, Penang\'s George Town is a feast for the senses', 'In the beginning was the word, and the word was light. Or, in this case, Francis Light, an illegitimate English freebooter who turned Penang into the premier Asian trading hub of the 18th century, earned himself a fortune and sired six children for a Thai-Portuguese princess. Or so the better sort of legend has it.^^Today, it\'s tourists as much as traders who head to Penang; but the island retains more than a little of the cosmopolitan richesse of the Light era, especially in the old quarter of George Town, which is lined with the shophouses that are the icon of the Chinese Asian diaspora, and dotted with museums, boutique hotels and the sort of whimsical tycoon\'s mansion - Cheong Fatt Tze\'s blue one is a prime example - that were part status symbol, part adult adventure playground.^^Yet the core attraction is George Town\'s vibrant ambience: if someone could work out how to bottle that, they\'d outsell the iPhone 6S. Never mind that some random factotum from Unesco slapped the place with a World Heritage bumper sticker, it\'s a hypnotic blend of Malaysia\'s three main cultures and races - Chinese, Indian, Malay - and many more besides.^^\"Europeans, Arabs, Armenians, Jews, Burmese, Thais, Bugis, Ambonese, Javanese, Acehnese, Rawanese, Minangkabaus [from the highlands of western Sumatra], Tamils, Malabaris, Gujaratis, Bengalis, Parsis, Cantonese, Hokkiens, Hakkas, Teochews, Hainanese, Ceylonese, Sikhs, Japanese, Filipinos - all these were active participants in the creation of a cosmopolitan city,\" says Khoo Salma Nasution, who wrote the definitive Streets of George Town guidebook and is director of the Lestari Heritage Network.^^Not so much a melting pot as a supersized smoothie, part of George Town\'s appeal lies in its sheer modesty. It\'s an honest-to-goodness, everyday community, where people live and work, rather than some sort of ersatz, touristic showpiece. Nobody\'s hawking tacky George Town trinkets or blathering about the \"George Town experience\". Even the sales clerk at the World Heritage office, on Carnarvon Street, seems slightly taken aback by a request to purchase a map, and has to scrabble through several cupboards to find one that\'s up-to-date. Welcome to the Malaysian laid-back island idyll, which - just to shade in a little contrast - produced such diverse characters as Jimmy rhymes-with-shoe Choo and that very well-known politico Anwar Ibrahim.^^Naively, in the weeks preceding this trip I bought a second-hand phrase book, wrote out a score of flash cards, and learned to count up to sembilanpuluh sembilan(99) in Bahasa Malaysia. Yet even before I stepped outside the airport arrivals hall it was blatantly apparent that everyone spoke English, or perhaps Minglish-lah, not only to me but to each other, although some Chinese are happier nattering in hwayu (overseas Chinese language), as they dub Putonghua.^^But one Malay word - syiok - prove invaluable. Slang for \"great\", it carries nuances of pleasure, ease, cool, amusement and general bonhomie.^^It is syiok to glide into a hawker centre for breakfast, lunch, dinner or any of the other meals that seem to stretch throughout the day. The set-up varies little: tables and chairs in the middle, Chinese, Malay, Indian plus maybe Japanese and Thai cook-stalls around the sides, ceiling fans pirouetting vaguely overhead - although the temperature doesn\'t ever drop much below 27 degrees Celsius - and not much in the way of walls. At four ringgit (HK$7) a plate there\'s never any doubt that you\'re getting your money\'s worth. There\'s everything from chilled Bintang beer to freshly squeezed lime juice at the drinks stall. Few meals are completed in a hurry.^^It is syiok to drop by a spice merchant in Little India for a clutch of aromatic holiday memorabilia, delving into the vast sacks and barrels, mingling with the other people in the shop - never less than a cricket team\'s worth - who might have been customers, staff, friends or distant cousins.^^Syiok, too, to board a trishaw - 30 ringgit for an hour\'s pedalling and only slightly garbled commentary by the veteran pilot - and spin along streets whose very names trumpet Penang\'s history: Victoria, Armenian, Farquhar, Light (of course) and Stewart. And where would George Town be without Love Lane?^^And it is syiok simply to wander the streets, admiring the triumphant form-follows-function shophouses, which open right onto the five-foot-way pavements, are narrow but deep, and flooded with light and air via an interior courtyard. Renovated or dilapidated, some following their traditional calling, others teetering on the edge of the dustbin of history, every single one is a cultural crown jewel, cocking a valiant snook at the 232-metre-high Komtar Tower, an incongruous cylindrical erection on the fringe of the old quarter, a \"monstrous carbuncle\" in Charles Windsor\'s vocabulary, or what American writer Bill Bryson would have classified as a hideous example of the \"Far Queue\" - to put it politely - school of architecture.^^Here and there, George Town\'s public spaces are etched with murals by Lithuanian artist Ernest Zacharevic, whose work evokes comparison with Norman Rockwell\'s oeuvre. Complementing these, wrought-iron sculptures - each a nugget of George Town life - spotlight a gallimaufry of diverse subjects, such as the Indian soothsayers who used parakeets to tell fortunes, Ting Ting Thong (sugar, sesame seeds and nuts) rock candy and the hole made by a cannon ball in the 1867 riots. Each sculpture takes on the role of a still-life guide.^^While other Asian islands have plumped for the sun-sea-and-sand formula, Penang\'s street cred comes from its vibrant culture. George Town steps into the international limelight every summer, when its arts festival - conjured from practically nothing in 2010 by textile tycoon Joe Sidek - draws acts as diverse as a Japanese interpretation of Kafka\'s Metamorphosis, Iranian experimental theatre, a Spanish troupe who mix flamenco with breakdance and Polish puppeteers enacting the last days of movie legend Marlene Dietrich.^^Yet with a metropolitan landscape that\'s more or less a living museum, a heritage that doesn\'t need labelling by international busybodies and a lingua franca that outstrips Esperanto, George Town does the culture jive 365 days a year. Or 366 in 2016.^^', 'Looi Soong Ern', 'Georgetown3.jpg'),
(7, '8 THINGS TO KNOW BEFORE YOU GO TO PENANG, MALAYSIA', 'Start with art. Many people visit Penang to wander the narrow lanes of its attractive colonial-era capitalâ€”and UNESCO World Heritage siteâ€”George Town, armed with their cameras. One of the best ways to explore the town is to follow the mural trail: in the area around the old British fort, there are over 50 murals and sculptures on the walls of its 19th-century buildings, many of which were once Chinese storefronts. (My favorite mural is a dainty ballerina painted over an entryway on Love Lane.) There are several routes and maps to help you navigate the artwork, but make sure you go before 9 a.m. to beat the heat and the crowds.^^Donâ€™t confuse â€œMalayâ€ and â€œMalaysian.â€ Malays are the countryâ€™s largest ethnic group, but not all Malaysians are Malay. Malays, who have Austronesian heritage, speak the Bahasa Melayu language and are generally Muslim (the Malaysian constitution states that ethnic Malays must be Muslim or they are not legally Malays). They comprise about 60 percent of Malaysiaâ€™s population, but most Penangites trace their ancestry elsewhere. The island was mostly uninhabited until the British started using Penang as a shipping port, attracting laborers and traders from around the globe, and by 1802, around 14 languages were spoken in George Town. By 1829, Chinese-origin groups became the ethnic majority and remained so until 2010, when Malays became the largest ethnic group.^^Check the calendar. With four major religions representedâ€”Islam, Buddhism, Hinduism, and Christianityâ€”there is a high chance that public holidays and festivals will affect your travel experience. The best time to catch a festival (and the worst time to get anything administrative done) is the fall, when Penang celebrates Diwali, the Chinese Nine Emperor Gods Festival, and this year, Muharram, the Islamic New Year. Avoid traveling the week of Hari Raya (currently in July) when most of the Malay population visits family, clogging roads and filling hotel rooms. Make sure to check a Malaysian calendar before planning your trip.^^Eat with purpose. Penang is known as a regional food paradise, with a rich cuisine shaped by the islandâ€™s many cultures, including Hokkien, Hakka, and Teochew-speaking Chinese communities, Indian Tamils, Malays, and the British. Malaysians from elsewhere drive hours to visit one of Penangâ€™s famous holes-in-the-wall or hawker carts for fragrant spicy noodle soup (laksa) or a superlative steamed bun. Penangites have turned an obsession with discovering the best flavors into a sport. To get in on the game, visit as many hawker stalls in a day as you can. You can also take a food tour, a cooking class, or retrace a local food bloggerâ€™s must-eat list (try Ken Hunts Food). Donâ€™t forget to upload photos of your meals to a local Facebook food group. The group Jalan-jalan Cari Makan Di Pulau Penang has over 86,000 members.^^Get to know mee. The Penang street food staple is the noodle. The word for noodle, mee, is one of the few crossover words used by almost all Penang languages, and Penangâ€™s noodle game can be overwhelming. There are rice noodles and wheat noodles, egg noodles and clear vermicelli, flat noodles, round noodles, and noodles so fat they look like churros (char hor fun). The must-haves are slippery round noodles in a fragrant, sweet and sour coconut sauce (laksa), flat noodles tossed over very high heat with shrimp paste and sausage (char koay teow), egg noodles and rice noodles stir fried together in dark soy sauce (hokkien mee), and noodles in curried coconut soup (curry mee). (By the way, the best curry mee is at Sisterâ€™s, behind the Air Itam Market.)^^Keep cash on hand. Cash is still king in Penang, especially outside of George Town. But even there, most of the best places to eat are usually no-frillsâ€”where you stand with your bowl in a crowded back alleyâ€”so keep a wad of small bills. Donâ€™t expect coffee shops, food hawker centers, or that guy selling coconuts on the corner to accept a credit card. Luckily, ATMs are easy to find, even in the more rural parts of the island. (CIMB Bank allows the biggest withdrawals).^^Watch your table manners. With so many cultures, dining etiquette varies. At a Malay or Indian warung, you might use a fork to chase bits of rice onto a spoon, or you might use your hands to mash rice and sambal into a ball. At a Chinese restaurant, youâ€™ll use chopsticks and maybe a wide ceramic spoon. The key to having good manners is to be flexible, observant, and a good copycat.^^Listen for Manglish. Widely-spoken English is one of the relics of British colonialism (Penang was Britainâ€™s first colony in Southeast Asia), but with a twist. Many locals speak â€œManglish,â€ (Malaysian-English), an English-based creole with the grammar structure of the Hokkien Chinese dialect, plus words from Penangâ€™s other languages thrown in. This might not sound much like English to visitors, which can lead to some confusion. Listen for â€œlah:â€ appending a â€œlahâ€ to the end of sentences for emphasis is a hallmark of Manglish.^^', 'Alvin Yeap', 'art.jpg'),
(8, '8 Things NOT to Do in Penang', 'Kiss and cuddle excessively in public^ Most locals (especially conservative Muslims) refrain from showing excessive affection in public. There are also signs prohibiting kissing and hugging plastered on trains, buses and taxis. A peck on the cheek is fine for most people, but leave the full-on make-out session for behind closed doors!^^Accept an unmetered taxi^While budget taxis are convenient and affordable methods of getting around, cabbies here are notorious for refusing to turn on their meters and offering a fixed (and higher) rate. To avoid this, make sure the meter is switched on before entering the taxi. Use a dependable taxi app such as MyTeksi or EasyTaxi to book your ride. It is much easier to use and comes with affordable standard prices. ^^Shake hands (unless someone offers) ^As physical contact with the opposite sex is prohibited amongst locals who strictly practice Islam, do not be offended if your handshake is not reciprocated. To avoid a rather awkward situation, the best way is to keep your hands on your sides, smile and greet the locals with a friendly nod. ^^Enter holy places or homes with your shoes on^In Penang, it is customary to remove your shoes before entering homes and religious institutions. Perceived as a mark of respect, visitors are also required to dress appropriately (no shorts, sleeveless tops and short skirts) when visiting mosques, Hindu temples. ^^Leave home without your umbrella (during rainy season)^The weather in Kuala Lumpur stays hot and humid throughout the year with occasional rainfall, while heavy rains and thunderstorms hit the city usually between the months of March and April. During these rainy months, donâ€™t trust your instincts or even the weatherman: always bring an umbrella when youâ€™re out exploring the city. ^^', 'Vincent Loy', 'dont.jpg'),
(9, 'WHAT NOT TO DO WHILE TRAVELLING TO PENANG', 'Have you ever travelled to a new country only to be confused by certain customs and practices? Walked the roads of a new city uncertain as to how you should behave? Every country has its own customs, standards of behaviour and taboos and often times they remain undiscovered until those practices are breached. Amidst questioning looks, confused stares and, sometimes even, expressions of angry disbelief, a traveller learns fast what is not acceptable in the places they visit.^^^^Getting Lost in the Customs of Malaysia^Malaysia is no different. Quickly becoming one of the hottest and most popular travel destinations, it is a multi-cultural, multi-lingual and multi-ethnic country rich in variety of foods, traditions, and history.^^With a core society of indigenous Malay, Indian and Chinese, the culture of Malaysia has also found influence from other areas of the world, from Britain to Persia, Europe to the Arabic nations. With so much diversity it can get confusing for a traveller to know exactly what customs to follow.^^Before we first visited Malaysia, we had heard tons of â€˜dos and donâ€™tsâ€™ from fellow travellers and we supplemented that with lots of research on the issue ourselves. While we didnâ€™t notice all of these rules in play, possibly because we spent most of our time in the tourist-friendly Georgetown, Penang, we definitely were aware of some stark differences in practices between our own culture and that of the people in Malaysia. Weâ€™re sure if we had stayed longer, we may have noticed an even more stark contrast.^^If youâ€™re looking to make sure you donâ€™t breach any behavioural rules while visiting Malaysia, the following will give you a good idea of what not to do in Malaysia.^^^^Be Aware of Gestures Considered Rude or Obscene^Gestures are a difficult thing to control as they often come automatically. When in Malaysia, itâ€™s good to avoid a few gestures that are not acceptable in Malaysia but may be commonly acceptable in other parts of the world.^^For instance, the head is considered the most sacred part of the body and as such, should be respected. Touching the head of an adult or passing an object above someoneâ€™s head is considered rude and disrespectful.^^While common in a lot of western cultures, using the forefinger to point is seen as a rude in Malaysia and instead, make a fist with your thumb over top the fingers and point using the thumb as the directional guide. We noticed about half of the people would point with their finger and the rest with their thumb over fingers. Weâ€™ve also found that in many places â€œpointing in a directionâ€ with your whole hand open-palm, works very well.^^Pounding your fist into the palm of your other hand is an obscene gesture to some people in Malaysia and should also be avoided.^^^^Take Into Account Gender-Based Considerations^An important consideration in many places is the difference in acceptable behaviour from, and between, men and women. In Malaysia, men and women should avoid embracing and kissing in public. Public behaviour and image is incredibly important and public displays of affection are not considered appropriate.^^Women should also take care in the beachwear they choose. Topless sunbathing is not allowed and while some tourist areas allow bikinis, many Malay women will swim fully clothed.^^Interaction between unfamiliar men and women also comes with taboos. Donâ€™t be offended if a member of the opposite sex does not return an extended hand for a handshake. In Muslim culture, physical contact between members of the opposite sex is not encouraged and may not be reciprocated. If you are a man, wait for the woman to offer her hand first. With a country as diverse in culture as Malaysia, itâ€™s not always easy to identify what beliefs a particular person holds.^^^^Remember Table Manners and Guest Etiquette^Table manners and guest etiquette change significantly from country to country, and even sometimes city to city. What you have been told as a child may not always apply to another country or culture. In Malaysia, there are several important rules to remember when acting as a guest.^^You may be used to showing signs of embarrassment when burping as it is often considered rude to do so in public in many Western countries, but in Malaysia burping after a meal is typically acceptable and a regular part of dining etiquette. On the flipside, wearing your shoes upon entering someoneâ€™s home, a mosque or a temple is a definite faux-pas. ^^Remove your shoes before entering a house or place of worship as a sign of respect.^^A related custom is ensuring the soles of your feet do not point at people or sacred images. When in public, ensure that your feet are facing towards the ground and are not propped up exposing the soles to others.^^In Malaysia, there are apparently fairly strict customs for using your hands to eat. Always eat with your right hand, even if you are left-handed, as the left hand in Malaysian culture is usually reserved for bathroom-related behaviours. If you are left handed and cannot get used to the right-handed way, ask for utensils.', 'Tan Khai Shian', 'whatnottodo.jpg'),
(10, 'The Best Hotels in Penang', 'The Best Hotels in Penang^^^^Shangri-Laâ€™s Rasa Sayang Resort & Spa â€“ Batu Ferringhi^An upscale beachfront resort, home to the best spa in Penang, two pools, and five outstanding restaurants. All rooms are spacious and luxuriously appointed, many with balcony soaking tubs. Rooms and suites in the Rasa wing include exclusive access to the adults-only pool, plus complimentary afternoon tea service and evening cocktails and light bites. The spa features holistic Malay and Chinese treatments in private villas. Family amenities include a turtle hatchery, indoor playground, and childrenâ€™s pool. Expect impeccable service, sumptuous gardens, and pure relaxation.^ Hotel phone: +60 4-888 8888^^^^Hard Rock Hotel Penang â€“ Batu Ferringhi^For unforgettable family vacations, the Hard Rock has everything: the largest free-form pool in Penang, complete with waterslides and a play area, kidsâ€™ and teensâ€™ clubs, plus family suites with a separate kidsâ€™ minibar, toys, and patio play areas. Their Lagoon Deluxe rooms allow guests to dive into the pool straight from their decks or grab a drink from a swimming bartender. True to their musical theme, the hotel offers loaner guitars and DJ mixing stations, while its spa has massage tables on top of vibrating speakers. This hotel is right on Bat Ferringhi beach, walking distance to the night market, accessible to Entopia Butterfly Farm and the Tropical Spice Garden and about thirty minutes from George Town.^Hotel phone: +60 4-881 1711^^^^The Eastern & Oriental Hotel â€“ George Town^This oceanfront, all-suite hotel boasts two pools, a luxury Thai spa, and world-class bars and restaurants. This historic space once hosted colonial-era elites, including Rudyard Kipling and Hermann Hesse, and the hotelâ€™s design and dÃ©cor remains largely unchanged, with claw foot tubs, checkerboard tile floors, original light fixtures, and period-era replica furnishing. Suites are enormous, beginning at 57 square meters. Heritage Wing suites all include the E&Oâ€™s signature butler service. Located on the seafront in downtown George Town, near Little Penang Street Market, the Goddess of Mercy Temple, and plenty of cafes and historic sites.^Hotel phone: +60 4-222 2000^^^^Golden Sands Resort â€“ Batu Ferringhi^Family-centered and beachfront, this hotel features two lagoon pools, a mini water park, indoor playground, Segway rides, and a turtle hatchery. Rooms and suites are spacious, with nature-inspired dÃ©cor, connecting options and a variety of layouts, some with fun Murphy beds and wraparound balconies. Three casual restaurants are onsite with Western and local foods. Situated on Batu Ferringhi beach and walking distance to the night market and local restaurants.^Hotel phone: +60 4-886 1911^^^^Hotel Equatorial Penang â€“ Bayan Lepas^A five-star hotel offering a large pool with a grotto and kidsâ€™ area, several fantastic restaurants, a nature trail, and a cozy spa. Their signature restaurant, The View, features French fine dining with a focus on experience; do not miss the coffee flambe! Rooms and suites are spacious, all with long baths and balconies, some with kitchenettes. Serviced apartments are available with up to three bedrooms. Butler service is available for Club Class rooms and suites. The hotel sits in Bayan Lepas, overlooking Penang Golf Club, near the Snake Temple and the airport.^Hotel phone: +60 4-632 7000^^^^Macalister Mansion â€“ George Town^This stylish, eight-room boutique blends colonial charm with contemporary glamor and features an outdoor pool and four trendy bars and restaurants. Each room is unique, but all are large and fashionably decorated with blond woods, abalone mosaic tiles, and a white and grey palette. Outside, the building retains its original British-era plantation shutters, iron railings, and art glass awning. Its unique, all-white Dining Room is a popular spot for weddings and special events, while the other bars and cafes here are livelier and more casual, with top-tier food and cocktails. Macalister Mansion is in a quiet neighborhood, halfway between downtown George Town and the Gurney Drive shopping area.^Hotel phone: +60 4-228 3888^^^^', 'Shirlyn Ooi', 'shangrila.jpg'),
(11, 'Top Ten Penang Attractions', 'Top Penang Attractions^^^^What are the top Penang Attractions? If you are proposing to visit Penang Island you will find that there is so much to see and things to do that you will probably not have sufficient time to do everything.^^Some planning of what to see is required if you want to cover most of the main Penang tourist attractions without feeling rushed.^^^^Historic George Town^As a UNESCO World Heritage city, Penang\'s capital George Town is like a living museum, crammed full of historic buildings and colourful streets. The best way to tour it is on foot. Take my Penang Heritage Trail which will cover the main sights.^^^^Penang Botanic Gardens^Penang Botanic Gardens are the Pride of Penang. One of the top botanical gardens in South East Asia and a must-see Penang attraction.^^^^Dhammikarama Burmese Temple^Located in Lorong Burma in George Town, this Buddhist temple was founded in 1803 and features a serene Buddha statue with white marble face and hands, a wishing pond and some Burmese-style temple buildings including the newly completed Golden Pagoda Bell Tower which opened in May 2011^^^^Wat Chaiyamangalaram^Across the street from the Burmese Temple is this Thai Buddhist Temple. Very different in style, it includes a 33 metre long gold-plated reclining Buddha statue, one of the world\'s largest. The walls of the temple housing the reclining Buddha are lined with thousands of small Buddha statues sponsored by devotees.^^^^Entopia by Penang Butterfly Farm^Entopia is a world class vivarium where butterflies flutter freely amid lush tropical gardens. Definitely one of the Top Penang Attractions.^^^^Colonial Penang Museum^Colonial Penang Museum is one of Malaysiaâ€™s best museums with fantastic collections of antique furniture, stained glass windows and collectable treasures. ^^^^Penang Toy Museum^The Toy Museum houses a massive collection of action figures and collectables relating to movies, comic book superheroes and TV programmes ranging from Harry Potter to Star Wars. Fun for kids of all ages^^^^Batu Feringgi^This is Penang\'s most popular beach area where many resort hotels are located. Besides the normal beach pursuits, there is a wide range of dining and entertainment outlets together with a night bazaar to bargain for those clothing, accessory, gift and souvenir items.^^^^', 'Nathan Teoh', 'attractions.jpg'),
(12, 'Best Penang Nightlife', 'Best Penang Nightlife^^^^ 1 ) Hawker Food^ Easily making it onto our list of Top 10 nightlife experiences in Penang is the islandâ€™s local hawker food scene which really comes alive at night, when notable, sprawling open air venues found along Jalan Batu Ferringhi, Gurney Drive and Georgetownâ€™s New Lane begin operations. Our favourite is New Lane Hawker Centre, just a minuteâ€™s walk from Sunway Hotel Georgetown, for its char koay kak, a dish of pickled vegetables, rice cake, bean sprouts and fried egg. Also good is almost-everything at Gurney Drive Hawker Centre (but it tends to get really packed), and Long Beach Food Court along Jalan Batu Ferringhi, which offers pretty inexpensive food (RM5 for a plate of fried rice) given its location.^^^^ 2)  Live Music^ The local music scene is Penang is a thriving industry. The island plays host to several music festivals throughout the year including the Penang Island Jazz Festival, Malaysiaâ€™s second largest performing arts event held in August, and the Penang World Music Festival taking place between March and April. However, visitors looking for all year round live entertainment will not be disappointed as several island bars host live acts regularly. Our top choice is the iconic Hard Rock CafÃ© along Jalan Batu Ferringhi, where live local performers rule the roost, but international artists make stage appearances from time to time. For a more casual vibe, Reggae Mansion on Lebuh Chulia has an outer lounge where local performers are sometimes free to take the mike.^^^^ 3) Penang Dance Clubs^ For fun vibes and Latin rhythms, head to Slippery Senoritas, an island institution on Upper Penang Road famous for its salsa tunes, or try Jamminâ€™ at Pengkalan Weld, which has a weekly Thursday tango night. Alternatively, M2 Club specialises in local fusion dance music, while Soju Room and Storm are great choices for those keen on the EDM music scene. The first two are in the basement levels of Penang Times Square, while Storm is set along Lebuh Chulia. The one thing they all have in common is that music is loud and drinks are strong, making it all the more easier to move to the beats ^^^^4) Cocktail Lounges^ Penangâ€™s catalogue of great nightlife experiences continues with its array of classy cocktail lounges. Bartenders whip up some genuinely inventive and tasty candy-coloured drinks and all venues offer a winning formula of flavoursome, imaginative drinks, pleasing interior design, comfy seats, and background music that lets you have easy conversation with pals. A couple of our favourites are the rustic, Peranakan-style Baba Bar, and the fashionable G Lounge (in G Hotel along Gurney Drive) which has a 46-metre bar, the longest on the island.^^^^', 'Ong Yow Huah', 'nitelife.jpg');

