INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(11, 'weilun', 'Beautiful and serene temple', 'A big and beautiful temple on the hill. Some walking (many steps to reach the top!) Required however there is a reclining lift available for those who have difficulties walking the steps and slopes. It\'s about RM6 per pax for the lift and RM2 to walk up the pagoda where you can also enjoy the breeze, scenary and also look at the large goddess of mercy. The temple is beautiful, large and with lots of stuff for sale.', 'Kek Lok Si Temple.jpg', , '2018-10-22 16:11:12');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(12, 'jeanmin', 'Great way to spend a day in historic Georgetown', 'Get hold of the Street Art Map (available in almost all hotels in Penang) and hit the streets. Some of this murals are really hard to find, so its almost like a treasure hunting expedition. \r\nDon\'t forget to savour the interesting street hawkers and cafe that are sprinkled all over this historic place.\r\nHave fun!', 'art.jpg', , '2018-10-22 16:20:41');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(13, 'jess', 'Entertaining place to visit with family', 'I visited here with my wife and 4 year old son and for one price I was able to access a tech dome with science fun for kids, some fun play areas for kids, dinosaur fun place for kids with life size dinosaurs, play area for kids with some rides and able to access the sky view levels on level 65 and 68. There was a variety of food to choose from which is good and the place was clean. But one warning donâ€™t eat or drink anything on level 68 as it is expensive and disgusting and I had the worst cocktail ever there. Overall worth a visit.', 'dinasour.jpg', , '2018-10-22 16:22:47');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(14, 'soongErn', 'Nice hikes', '\r\n302talitham\r\nArnhem, The Netherlands\r\n581128\r\nReviewed 1 week ago via mobile\r\nNice hikes\r\nEasy accessible by motor bike, taxi or bus. You have to check in at the start (but weirdly enough they do not need you to check out). We went on the hike to turtle beach, it can be a bit challenging at times but was a great, beautiful hike. Once on the beach, there\'s an option to take a local boat back.', 'penang-national-park.jpg.jpg', , '2018-10-22 16:22:56');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(15, 'yowhuah', 'Relaxing walk', 'It was an interesting place where people actually lived there and set up stalls in front of their house selling souvenirs, snacks and clothes. The sea view at the end of the jetty is not that fantastic but I like the old village feels walking through the boards.', 'chewJetty.jpg', , '2018-10-22 16:23:04');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(16, 'jcong', 'Great way to spend a day in historic Georgetown', 'Get hold of the Street Art Map (available in almost all hotels in Penang) and hit the streets. Some of this murals are really hard to find, so its almost like a treasure hunting expedition. \r\nDon\'t forget to savour the interesting street hawkers and cafe that are sprinkled all over this historic place.\r\nHave fun!', 'budget_wp.jpg', , '2018-10-22 16:23:11');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(17, 'nathan', 'A surprisingly excellent tour- a must see!', 'We stumbled across this mansion on a hot afternoon to keep out of the sun... And we were pleasantly surprised! There are daily English\'s tours (ours started at 2pm) and last about 1.5 hrs. Our guide was very charismatic and walked us through all the main artefacts and rooms. It\'s much bigger and ornate than first meets the eye... And you can enjoy a locally sourced juice at the end if you fancy it!', 'Peranakan mansion museum.jpg', , '2018-10-22 16:23:19');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(21, 'mackhem', 'Nice gardens, with a creek and waterfalls, plenty of monkeys', 'An enjoyable day spent at the Botanical Gardens, it was hot so we opted for the tour in the cart. Lots of identified plants, plenty of monkeys, a couple of water monitors, Sad that the orchid garden was closed.', 'Penang Botanic Gardens.jpg', , '2018-10-23 13:13:11');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(22, 'alvinYeap', 'A history of photography in one room.', 'It was a real treat coming here. For only a 10 RMY entry fee, you get an enthusiastic and knowledgable guide, hunderds (possibly thousands) of cameras, movie cameras, projectors, dark room equipment, a camera obscura, and photographs. A lot of the exhibits can be handled and otherwise interacted with, so even teens who have only ever taken snaps on their smart phones won\'t get bored here. Really good for an hour or two.', 'camera-museum-1_mini.jpg', , '2018-10-25 22:48:11');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(23, 'vincent', 'Best plaza', 'Shopper & foodies paradise! Top 3 shopping centres in Penang.\r\nHas an international atmosphere & very good selection of shops.\r\nTry Owndays for good & cheap glasses. Service by Joyce is very good & attentative too. So is RSH sports shop. Look for Tafiq for a good experience - in golf accessories etc.\r\nGo to their basement for excellent food & a big Cold Storage store to stock up for your stay.\r\nHighly recommended to visit.', 'Gurney Paragon Mall.jpg', , '2018-10-25 23:34:20');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(26, 'sarah', 'Awesome place', 'I would always suggest a good guide for the visit of this breathtaking place. Otherwise you donâ€™t get half the informations about this wonderful place. So much to discover.', 'Khoo Kongsi.jpg', , '2018-11-13 11:43:20');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(27, 'rainWan', 'A fascinating insight', 'Looking back in time in a real house that has become a museum was fascinating. The guide was very good at explaining what we were looking at and how it related to the family and their heritage', 'Sun Yat Sen museum.jpg', , '2018-11-13 12:24:04');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(28, 'YoungBae', 'Its fun!!! Great place to click selfies...', 'I visited this place with my wife and my 4.5 years old daughter. We had a great time. It was so much fun posing for pics in different sections. The staff was very patient setting us up for the pics. My daughter also was super excited and loved posing for pics. But at the end of the day, its more of visiting the place and getting pics clicked, which u can see later and enjoy.', 'Upside down museum.jpg', , '2018-11-13 12:24:34');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(29, 'Jennie', 'Old Penang History', 'Enjoyed seeing this Mansion as part of Georgetown\'s colourful history. Fabulous insight as to the developement of Penang & how life evolved. Thoroughly enjoyed the tour.', 'Cheong Fatt Tze Mansion.jpg', , '2018-11-13 12:26:26');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(31, 'Lisa', 'The best theme park ever!', 'This is the best theme park in malaysia. we had a great experience for two days one night in adventure play, base camp and water theme park ... and most fun is all the staff in escape fiendly, and very very helpful. especially sumon!', 'Escape theme park.jpg', , '2018-11-13 12:29:18');
INSERT INTO `community_speedtravel` (`id`, `UN`, `title`, `description`, `imageName`, `image`, `lastUpdate`) VALUES
(32, 'Rosee', 'Interesting and fun', 'The time tunnel is a great way to learn a bit more about the history of Penang. It is well set out and has lots of interesting facts. When you have completed the tour you can have some fun getting your photo taken in different rooms in different poses.', 'timeTunnel.jpg', , '2018-11-20 15:06:40');

