INSERT INTO `hotspot_speedtravel` (`id`, `place`, `detail`, `location`, `operatingHour`, `image`) VALUES
(1, 'Georgetown world heritage site', 'George Town has been inscribed as a UNESCO World Heritage Site since 2008. Established as an entrepÃ´t by Francis Light of the British East India Company in 1786, George Town was the first British settlement in Southeast Asia.', 'Georgetown, Penang', '24hours', 'Georgetown world heritage site.jpg'),
(2, 'Penang Botanic Gardens', 'Penang Botanical Gardens are usually simply called the Botanic Gardens by Penang islanders. Also known as the Waterfalls Gardens, the gardens are located in a valley along Jalan Kebun Bunga. It is a well landscaped place that contains a huge variety of indigenous and exotic plant species.', 'Pavilion Administrative Complex, Jalan Kebun Bunga, 10350, Penang', '0500 to 2000', 'Penang Botanic Gardens.jpg'),
(3, 'Penang State Museum & Art gallery', 'Penang Museum & Art Gallery is set on the junction of Lebuh Farquhar and Lebuh Light in Georgetown. ^^Established in 1821, it houses national and state treasures that include a collection of Baba Nyonya porcelain, furniture, jewellery and costumes as well as eight oil paintings by Captain Robert Smith.', 'Lebuh Farquhar & Lebuh Light', '0900 to 2300', 'Penang State Museum & Art gallery.jpg'),
(4, 'Fort Cornwallis', 'Fort Cornwallis is the largest standing fort in Malaysia. Set close to the Esplanade and Penang Clocktower, the star-shaped bastion is one of the oldest structures in Penang. Named after Marquis Charles Cornwallis, only a set of ten-foot high outer walls remain, with an enclosed park within.', 'Lebuh Light', '0900 to 1830', 'Fort Cornwallis.jpg'),
(5, 'Escape theme park', 'Park offering a high ropes course, zip lines, slides, a climbing tower & kid-friendly attractions.', '828, Jalan Teluk Bahang, Teluk Bahang, 11050, Pulau Pinang', '1000 to 1800', 'Escape theme park.jpg'),
(6, 'Penang Hill', 'Penang Hill was the first colonial hill station developed in Peninsular Malaysia. Comprising Western Hill, Bukit Laksamana, Tiger Hill, Flagstaff Hill and Government Hill, it is located six km away from Georgetown. The hilly and forested area is the state\'s primary hill resort.', 'Jalan Stesen Bukit Bendera | Air Itam, George Town, Penang Island 11500, Malaysia', '0630 to 2300', 'Penang Hill.jpg'),
(7, 'Khoo Kongsi', 'The Khoo Kongsi is a large Chinese clanhouse with elaborate and highly ornamented architecture, a mark of the dominant presence of the Chinese in Penang, Malaysia. The famous Khoo Kongsi is the grandest clan temple in the country. It is also one of the city\'s major historic attractions.', '18 Cannon Square, Georgetown', '0900 to 1700', 'Khoo Kongsi.jpg'),
(8, 'Batik painting museum', 'The museum is housed in an old shop house on Lebuh Armenian that\'s within George Town\'s Heritage area. This Musuem aims to tell the historical story of how this art form began in the 1950\'s and its subsequent development by a good number of talented artists in Malaysia. ^^During the time, Chuah Thean Teng, an artist living in Penang, started to combine his artistic skills with old traditional batik technique that uses dye-resist process in making decorative motifs and designs on fabric. Soon after, other Malaysian artists followed in his footsteps thus creating new techniques and diversified styles. ^^ In this museum, there are 70 examples of the craft\'s evolution including Chuah\'s early and current pieces. A small number of artists in other countries also take up Batik Paintings. This Museum includeds a small section devoted to works by artists in China, Indonesia and Thailand.', '19, Armenian Street, 10200 Penang', '1000 to 1700 (Mon to Sun)^ 1000 to 1500 (Sat)', 'Batik painting museum.jpg'),
(9, 'Cheong Fatt Tze Mansion', 'The Cheong Fatt Tze Mansion is a government gazetted heritage building located on Leith Street in George Town, Penang, Malaysia. The mansion\'s external decorations and indigo-blue outer walls make it a very distinctive building, and it is sometimes referred to as The Blue Mansion.', 'Ground Floor, 14, Leith Street, George Town, 10200 George Town, Pulau Pinang', '1100 to 1630', 'Cheong Fatt Tze Mansion.jpg'),
(10, 'Penang toy museum', 'With more than 110,000 toys, dolls and other collectible items, it is the largest toy museum in the world.', 'Jalan Teluk Bahang, Teluk Bahang, 11050 Georgetown, Pulau Pinang', '0900 to 1800', 'Penang toy museum.jpg'),
(11, 'Sun Yat Sen museum', 'The Sun Yat-sen Museum Penang formerly called the Sun Yat-sen Penang Base, is a museum in George Town, Penang, Malaysia. The museum is dedicated to Sun Yat-sen, a nationalist from China who established the Chinese Republic in 1912 after his efforts in Xinhai Revolution.', '120, Lebuh Armenian, George Town, 10200 George Town, Pulau Pinang', '0900 to 1700', 'Sun Yat Sen museum.jpg'),
(12, 'War museum', 'Visitors can explore tunnels, war exhibits & related artifacts at this former fort with a dark past.', 'Jalan Batu Maung, 11960 Batu Maung, Pulau Pinang', '0900 to 1800', 'War museum.jpg'),
(13, 'The Owl museum', 'Museum offering an owl-inspired collection from around the world, plus activities & a souvenir shop.', 'Level B3, Astaka Bukit Bendera, Jalan Tunku Yahaya Petra, Bukit Bendera, 10000 Penang Hill, Penang', '0900 to 1900', 'The Owl museum.jpg'),
(14, 'Asia comic culture museum', 'Museum showcasing the history & culture of Asian comic books, with themed exhibits & profiles.', '2nd level ICT Mall, Komtar,, 10000 George Town, Penang', '1100 to 1900', 'Asia comic culture museum.jpg'),
(15, 'Penang National Park', 'The Penang National Park spans 1,213ha of land and sea and is used by scientists, researchers, and nature lovers to explore its natural treasures. Previously known as the Pantai Acheh Forest Reserve, this pristine site is known to harbour 417 flora and 143 fauna species.', 'Pejabat Taman Negara P. Pinang, Jalan Hassan Abbas, Balik Pulau, Pulau Pinang, 11050 George Town', '0800 to 1700', 'Penang National Park.jpg'),
(16, 'Saanen Dairy Goat Farm', 'It is a small family-run goat farm. The entrance is free but visitors can help to support the farm by buying their fresh goat milk, yogurt & other products.', '298 Mukim 1 Sungai Pinang, 11010 Balik Pulau, Penang', '1000 to 1700', 'Saanen Dairy Goat Farm.jpg'),
(17, 'Upside down museum', 'Playful museum with rooms creating the illusion that visitors are walking on ceilings & walls.', '45, Lebuh Kimberley, George Town, 10100 George Town, Pulau Pinang', '0900 to 1730', 'Upside down museum.jpg'),
(18, 'Karpal Singh Drive', 'Karpal Singh Drive is a seafront promenade within the suburb of Jelutong near George Town in Penang, Malaysia. It is named after Karpal Singh (1940-2014), a prominent opposition politician and lawyer who hailed from George Town', 'Karpal Singh Drive, Jelutong, Penang', '', 'karpalSinghDrive.jpg'),
(19, 'Kek Lok Si Temple', 'The Kek Lok Si Temple is a Buddhist temple situated in Air Itam, Penang, Malaysia, facing the sea, and is one of the best known temples on the island.', '1000-L, Tingkat Lembah Ria 1, 11500 Ayer Itam, Pulau Pinang', '0900 to 1800', 'Kek Lok Si Temple.jpg'),
(20, 'Penang Time Tunnel', 'Unique attraction exploring local history through 3D artwork, period artifacts & interactive murals.', '39, Jalan Green Hall, George Town, 10200 George Town, Pulau Pinang', '0915 to 1900', 'Penang Time Tunnel.jpg'),
(21, 'Tropicana fruit farm', 'Tours of 25 acres of hundreds of tropical & subtropical fruit trees, with samples included.', 'Jalan Teluk Bahang, 11000 George Town, Pulau Pinang', '0900 to 1700', 'Tropicana fruit farm.jpg'),
(22, 'Penang butterfly farm', 'Contemporary indoor/outdoor place with live butterflies & other insects, plus interactive workshops.', 'No.830, Jalan Teluk Bahang, 11050 Teluk Bahang, Pulau Pinang', '0900 to 1800', 'Penang butterfly farm.jpg'),
(23, 'Amazing World museum', 'Amazing World Studios is a smart partnership between Oxtra Capital Sdn. Bhd. and Warner Brothers. It features hands on exhibits and fun family activity. Possessing a camera is a prerequisite for visitors who wants to experience the unique side of Amazing World Studios. Featuring pop up art exhibitions, interactive computer-generated animation and 3D settings, visitors will enjoy every moment spent there.', '4 Weld Quay 10300 George Town, Penang', '0900 to 1830', 'Amazing World museum.jpg'),
(24, 'IBox glass museum', 'Creative glass art pieces are displayed at this compact museum offering custom-made souvenirs.', '6, Jalan Burma, George Town, 10050 George Town, Pulau Pinang', '0930 to 1800', 'IBox glass museum.jpg'),
(25, 'Dark Mansion Penang', 'Visitors can pose for photos with a variety of 3D glow-in-the-dark paintings at this offbeat museum.', '145, Lebuh Kimberley, George Town, 10100 George Town, Pulau Pinang', '1000 to 1830', 'Dark Mansion Penang.jpg'),
(26, 'Asia Camera museum', 'Explore more than 1000 cameras and photographic accessories that you may never see before.The majority of cameras are antique cameras.We have an extensive collection of the German cameras, Leica and Zeiss. Some of the highlights of the museum includes a rare Magic Lantern projector from the early 1900s with an antique large format hand painted glass colour slide and a 35mm silent movie projector that is illuminated using oil lamp and gear.', '71 (1st Floor, Lebuh Armenian, Georgetown, 10200 George Town, Penang', '1000 to 1800', 'Asia Camera museum.jpg'),
(27, 'Penang Gold museum', 'The PG Gold Museum provides visitors a glimpse into activities related to gold through a series of exhibitions, demonstrations and guided tour. The museum serves as an educational centre where visitors get the opportunity to have physical contact with the metal. There is a theatre where visitors get to view how precious metal is made into bars. They will also get a pouring demonstration where the metal are heated to a molten temperature and poured to form solid gold and silver bars. For the purpose of security, the demonstration uses silver rather than gold.', '95, Lebuh Bishop, George Town, 10200 George Town, Pulau Pinang', '0900 to 1800', 'Penang Gold museum.jpg'),
(28, 'Peranakan mansion museum', 'The Peranakan community is particularly concentrated in the Straits Settlements of Penang, Malacca and Singapore and today, the people of Malaysia are more colourful and we have another category of delightful cuisine, good news indeed to Malaysians who simply love eating. ^^A testament of the Peranakansâ€™ presence is the renowned Peranakan Green Mansion in Penang which offers a glimpse of Baba and Nyonya culture, lifestyles and traditions from the olden days. Here, more than 1,000 pieces of antiques and collectibles are well-preserved and placed on display, leading to the mansion being known as a famous Baba and Nyonya museum.', '29, Church St, Georgetown, 10200 George Town, Penang', '0930 to 1700', 'Peranakan mansion museum.jpg'),
(29, 'Penang trick art museum', 'Penang 3D Art Museum, located in Georgetown Lebuh Penang, is known as UNESCO World Heritage Site. Georgetown, Penang is currently undergoing some time. Rapid expansion and our new museum will allow growing cities to define themselves as regional Art hub. Our 3D art of art refers to the technology of converting 2D paintings into 3D paintings, Three-dimensional image. With the 2D painting on the wall, the floor and ceiling seem to pop up On the surface and came to life. Our museum introduces over 40 works including Illusion painting and sculpture. These are the arts that make us unique originated from the local. ^^In addition, Penang is Malaysia\'s first state to offer this unique art museum. Our museum is an interactive museum, its concept can stimulate your creativity', '10, Lebuh Penang, George Town, 10200 George Town, Pulau Pinang', '1000 to 1830', 'Penang trick art museum.jpg'),
(30, 'Made in Penang interactive museum', 'The Made In Penang Interactive Museum is another first for Penang. The museum showcases three-dimensional interactive art on the two levels of the building. The ground floor houses the Diorama Gallery while the upper floor the Penang 3D Gallery. In addition, there are Interactive Kiosks and a Video Presentation.', '3, Pengkalan Weld, George Town, 10300 George Town, Pulau Pinang', '1000 to 1830', 'Made in Penang interactive museum.jpg'),
(31, 'Wonder food museum', 'In Wonder food Museum Penang, you can see many local foods display such as a huge bowl size of nasi lemak, laksa, satay and so on. This museum is interesting because all the food displayed here are fake but look so real! While you can take photos with them, it is not advisable to eat them. It is an amazing place you will have to go.', '49, Lebuh Pantai, George Town, 10200 George Town, Pulau Pinang', '0900 to 1800', 'Wonder food museum.jpg'),
(32, 'Batu Ferringhi Beach', 'Located in the north-west of the island, Batu Ferringhi is home to a string of international class beach-front hotels, a long strip of white sandy beach, loads of water sports, a popular night market and is a great place to escape the heat of the city and relax by the pool enjoying the cool sea breezes. In the evening, the pavement along the main road running through town (Jalan Batu Ferringhi), turns into a night market, selling you all the things you never knew you wanted, from copy branded goods, to local arts and crafts.', 'Batu Ferringhi, Penang Island, Malaysia', '0945 to 1730', 'Batu Ferringhi Beach.jpg'),
(33, 'Penang Ghost Museum', 'Ghost Museum is an attraction in Penang for those who love a scare as it features the horror and myth of ghosts. In this Ghost Museum, you can see many types of ghosts such as Chinese ghost, headless ghost, Sadako and more. Besides, Ghost Museum also prepares many type of clothing and head-wear for visitors to experience being a ghost. You can try to overcome your fear by visiting this unique and fun museum in town.', '57, Lebuh Melayu, George Town, 10300 George Town, Pulau Pinang', '1000 to 1900', 'Penang Ghost Museum.jpg'),
(34, 'Colonial Penang museum', 'Colonial Penang museum will bring visitors back to Penang\'s colonial past. Experience the unique lifestyle of both the British Administrators & the wealthy merchants, appreciate the intricate art form from the past and the influence of British to our Penangites. Visitors can find unique antiques such as : Parchment handwritten document by Captain Francis Light, founder of Penang, and Francois Linke ,the Belle Epoque of French furniture. The museum can also be used as an educational instrument for students to promote the understanding and significant of our rich heritage in the past.', '7, Jalan Scott, Pulau Tikus, 10350 George Town, Pulau Pinang', '0945 to 1730', 'Colonial Penang museum.jpg'),
(35, 'Gurney Paragon Mall', 'Gurney Paragon Mall is Penangâ€™s best centre for an eclectic mix of fashion trends. Set along Persiaran Gurney, the seafront complex is home to more than 40 fashion boutiques and 30 restaurants. However, what makes Paragon utterly unique is the fact that the entire 700,000sqft complex has been built around St. Josephâ€™s Novitiate, a 1925 chapel that has been beautifully restored and incorporated into the mallâ€™s open-plan layout design.', '163-D, Gurney Dr, Georgetown, 10250 George Town, Penang', '1000 to 2200', 'Gurney Paragon Mall.jpg'),
(36, 'Teddy Ville museum', 'As the name suggests, is Malaysiaâ€™s first and largest collection of Teddy Bears from various nations and eras; as early as the 1900s. From one of the very first batches of teddy bear ever made, to miniature teddies and even human sized ones, thereâ€™s a teddy here for everyone. ^^The TeddyVille Museum is also the abode of Mini Penang, where miniature bears are dressed and placed in small sets that represent the many attractions that Penang has to offer. It is a cute and cuddly summary of the sights and experiences you should never miss upon a visit to our delightful island.', '56, Jalan Low Yat, Puncak Ria, 11100 Batu Ferringhi, Pulau Pinang', '0900 to 1800', 'Teddy Ville museum.JPG'),
(37, '5D interactive', '5D Interactive World is split into different \"district\". Interactive museum for all ages featuring playful educational displays using the 5 senses. More than simply a place to have fun, it aims at educating people particularly children. Various galleries teach as well as entertain. There is an exhibit on water conservation, another on trash disposal and recycling, and many more with sculptures for people to interact.', 'F, 29, Jalan Dato Keramat, Georgetown, 10150 George Town', '0900 to 1800(Closed on Monday)', '5D interactive.jpg'),
(38, 'AutoCity', 'Originally a swamp, the lands which AUTO-CITY sits on was bought and scheduled for development in the early 1990s: it was in the planning stages to become a corporate office tower when the Asian Economic crisis hit in 1997. The concept of a corporate tower was scrapped and thus it turned into AUTO-CITY. Beautifully landscaped with water features and gardens, the complex is located at the North-South Highway Juru Interchange.', '1688-F8, Jalan Perusahaan, Highway Auto-city, 13600 Perai, Pulau Pinang', '24 hours', 'AutoCity.jpg'),
(39, 'Queensbay Mall', 'Queensbay Mall, one of the finest shopping malls in Penang Island, is located in the heart of Bayan Lepas. The mall features 5 retail levels of international and home-grown brands including fashion, lifestyle, dining, entertainment, sports, electronics, home furnishing and department store.', 'LG-12A, Queensbay Mall, 100, Persiaran Bayan Indah, 11900 Bayan Lepas, Penang', '1000 to 2230', 'Queensbay Mall.jpg');

