INSERT INTO `review_speedtravel` (`id`, `UN`, `hid`, `title`, `review`, `rate`, `lengthVisit`, `visitMonth`, `dateTime`) VALUES
(3, 'weilun', 34, 'Colonial Penang Museum is like a Pearl of Penang', 'It was a rainy day when my friend ask me to visit this Colonial Penang Museum and it was not mentioned in my travel guide. I was surprised by the beauty of this mansion and the exposed collection of furniture of rich families in the Colonial period of Penang. ', 3, '1 - 2 hours', 'January 2018', '2018-11-20 17:40:04'),
(4, 'jess', 34, 'Fascinating place to visit!', 'I found the Colonial Penang Museum to be a fascinating insight into the history of Penang. In particular the wealthy and/or business families. The guide I had was a lovely person who had great knowledge of the subject. Recommend this museum.\r\n\r\n', 4, '< 1 hour', 'October 2018', '2018-11-21 09:07:14'),
(5, 'jeanmin', 34, 'Museum Worth Seeing', 'Great place. covering Penang recent history. Very informative and well presented. Displays are well organized and easy to understand. ', 4, '1 - 2 hours', 'November 2018', '2018-11-21 09:09:11'),
(6, 'soongErn', 34, 'Amazing antiques!', 'Had a guided tour around the colonial era mansion filled with antiques from Europe and elsewhere imported by Chinese merchants. Alvin was very enthusiastic and knowledgeable about the pieces, giving each of them context and even turning on the ones that still work!', 5, '1-2 hours', 'November 2018', '2018-11-21 09:13:38'),
(7, 'joe', 34, 'Interesting visit!', 'Interesting collections and antiques all in one place. Nice little attraction if you have a couple of hours to kill. The tour guide was knowledgeable and provided some interesting facts. The only downside was the flow the tour as I arrived midway so I had to join one tour which has started halfway and joined another for the introduction.', 3, '1-2 hours', 'November 2018', '2018-11-21 09:14:32'),
(8, 'weilun', 23, 'Wonderful Trip in Penang Island', 'I have wonderful experience in Penang Amazing World Studio. Use your imagination to interact with the characters from Warner Bros Movie 3D trick art on the wall . Posting yourself with pictures and turn it into wonderful pictures. Go and try it out how good is your imagination.\r\n\r\n', 4, '1 - 2 hours', 'November 2018', '2018-11-21 09:35:27');

